--[[
	id = 技能唯一id
name = 技能名字
skilldes = 技能描述
skilltype = 技能类型
duration = 持续时间
skillcondition = 技能触发条件类型
conditionvalue = 条件参数
skillrate = 技能触发概率
buffproarray = 触发buff概率数组
buffidarray = 触发buffid数组
revproarray = 解除概率数组
revabnarray = 解除异常值数组
target = 选择目标类型
range = 选择目标区域
shapes = 区域形状
repeatN = 选择重复次数
maxnum = 目标最大数量
point = 技能消耗点数
skillatkadd = 技能攻击加成
skillatkatr = 技能攻击属性
beatgrid = 弹飞格数
assault = 冲锋
effect_type = 技能表现类型
atk_effectId = 攻击者特效id
uAtk_effectId = 受攻击者特效id
red_time = 受击红闪延时
addtimes = 叠加次数,0表示不限制次数，大于1表示可以叠加最大次数
recover = 是否回收,0表示不回收,1表示回收

--]]
